(function() {
  var medalliaListeners = {
    'MDigital_Form_Displayed': {
      156: 283,
      158: 311,
      159: 289
    },
    'MDigital_Form_Close_No_Submit': {
      156: 284,
      158: 303,
      159: 290
    },
    'MDigital_Feedback_Button_Clicked': {
      156: 285,
      158: 304,
      159: 291
    },
    'MDigital_Invite_Declined':  {
      156: 286,
      158: 305,
      159: 292
    },
    'MDigital_Invite_Displayed': {
      156: 287,
      158: 306,
      159: 293
    },
    'MDigital_Invite_Accepted': {
      156: 288,
      158: 307,
      159: 294
    }
  };
  Object.keys(medalliaListeners).forEach(function(key) {
    window.addEventListener(key, function(data) {
      try {
        var eventId = medalliaListeners[key][data.detail.Form_ID];
        if(!!eventId) {
          QuantumMetricAPI.sendEvent(eventId, 0, location.pathname);
        }
      } catch(e) {}
    });
  });

  var surveyIdQmEventMap = {
    159: 299,
//     156: 300,
    7665: 300, 
    158: 310,
    7662: 295,
    7664: [296, 300], // hacking the survey submit to use the How Satisfied response to stop double counting
    7634: 297,
    7636: 298,
    305807: 309
  };
  window.addEventListener('MDigital_Submit_Feedback', function(data) {
    try {
      var surveyEventId = surveyIdQmEventMap[data.detail.Form_ID];
      if(!!surveyEventId) {
        QuantumMetricAPI.sendEvent(surveyEventId, 0, location.pathname);
      }
    
      if(!!data.detail.Content) {
        for(var i = 0; i < data.detail.Content.length; i++) {
          var medalliaQuestion = data.detail.Content[i];
          var eventId = surveyIdQmEventMap[medalliaQuestion.id];
          if(typeof eventId === 'number') {
            window.QuantumMetricAPI.sendEvent(eventId, 0, medalliaQuestion.value);
          } else if(typeof eventId === 'object') {
            eventId.forEach(function(id) {
              window.QuantumMetricAPI.sendEvent(id, 0, medalliaQuestion.value);
            });
          }
        }
      }
    } catch(e) {}
  });
})();

// Certona Events
(function() {
  QuantumMetricAPI.addEventListener(233, function() {
    try {
      var carousel = QuantumMetricAPI.lastClicked.closest('[data-module-type*="CertonaCarousel"]');
      var certonaType = carousel.querySelector('.certona-carousel__title').innerText;
      QuantumMetricAPI.sendEvent(250, 0, certonaType);
    } catch(err) { qmSendError(err); }
  });
  QuantumMetricAPI.addEventListener(236, function() {
    try {
      var foundProducts = [];
      var products = document.querySelectorAll('.certona-carousel__items .product-item');
      for(i = 0; i < products.length; i++) {
        var priceDiv = products[i].querySelector('.product-price__now-price-text') || products[i].querySelector('.product-item__price');
        if(priceDiv) {
          var price = parseFloat(priceDiv.innerText.replace(/[^0-9\.]/g,''));
          if(price > 10000) {
            var prodName = products[i].querySelector('.product-item__name').innerText;
            if(foundProducts.indexOf(prodName) === -1) {
              foundProducts.push(prodName);
              QuantumMetricAPI.sendEvent(301, 0, prodName); 
            }
          }
        }
      }
    } catch(e) {}
  })
})();

