// TRUEFIT
(function() {
  if (/\/product\//.test(location.pathname)) {
    function waitForTruefit(callback, attempts) {
      attempts = attempts || 0;
      if ('undefined' !== typeof window.tfcapi) {
        callback();
      } else if (attempts < 20) {
        setTimeout(function () {
          attempts += 1;
          waitForTruefit(callback, attempts)
        }, 250)
      }
    }

    // TrueFit Product listeners
    function truefitProductError(truefitData) {
      QuantumMetricAPI.sendEvent(213, 0, JSON.stringify(truefitData));
    }

    var productEventMapping = {
      'error': truefitProductError,
      'incompleteprofile': 210,
      'sizenotavailable': 211,
      'incompletegarment': 213,
      'invalidgender': 209,
      'render': 229,
      'success': 208,
      'nostyle': 214,
      'nouser': 228
    };

    // TrueFit Register flow listeners
    function truefitPageView(truefitData) {
      QuantumMetricAPI.sendEvent(203, 0, truefitData.pageName);
    }

    function truefitDiscoveryProductViewed(truefitData) {
      var val = [truefitData.department, truefitData.productType].join(' - ');
      QuantumMetricAPI.sendEvent(204, 0, val);
    }

    function truefitAddToBag(truefitData) {
      var value = [truefitData.style, truefitData.size].join(' - ');
      QuantumMetricAPI.sendEvent(215, 0, value);
    }

    var registerEventMapping = {
      'open': 202,
      'pageload': truefitPageView,
      'complete': 205,
      'discoveryproductsviewed': truefitDiscoveryProductViewed,
      'addtobag': truefitAddToBag
    };

    waitForTruefit(function () {
      var product = document.querySelector('.global-page-header__title').innerText;

      Object.keys(productEventMapping).forEach(function (truefitEvent) {
        tfcapi('event', 'tfc-fitrec-product', truefitEvent, function (context) {
          try {
            var qmCallback = productEventMapping[truefitEvent];
            if ('number' === typeof qmCallback) {
              QuantumMetricAPI.sendEvent(qmCallback, 0, product)
            } else {
              qmCallback(context);
            }
          } catch(e) {}
        })
      });

      Object.keys(registerEventMapping).forEach(function (truefitEvent) {
        tfcapi('event', 'tfc-fitrec-register', truefitEvent, function (context) {
          var qmCallback = registerEventMapping[truefitEvent];
          if ('number' === typeof qmCallback) {
            var product = document.querySelector('.global-page-header__title').innerText;
            QuantumMetricAPI.sendEvent(qmCallback, 0, product)
          } else {
            qmCallback(context);
          }
        })
      });
    });
  }
})();

