// Erratic payment scroll (2 scroll ups)
(function(){
  if(location.href.indexOf('/checkout/payment') > -1) {
    var lastScrollTop = 0;
    var lastScrollDirection = null;
    var scrollUps = 0;
    window.addEventListener('scroll', function(e) {
      var scrollPos = window.scrollY;

      if(scrollPos > lastScrollTop) { // scrolling down
        lastScrollDirection = 'down';
      } else { // scrolling up
        if(lastScrollDirection === 'down') {
          scrollUps += 1;
          if(scrollUps == 2) {
            QuantumMetricAPI.sendEvent(128, 0, null);
          }
        }
        lastScrollDirection = 'up';
      }
      lastScrollTop = scrollPos <= 0 ? 0 : scrollPos;
    })
  }
})();

